import React from 'react';
import './Complete.scss';

const Complete = (props) => {
    let word = '';
    if (props.story.loss === 0) {
        word = 'SUCCESS';
    } else {
        word = `-${props.story.loss*100}%`;
    }
    return (
        <div className='complete'>
            <div className='complete__prompt'>{props.story.story}</div>
            <h4>{word}</h4>
            <div className='complete__wrap'>
                <div className='complete__button' onClick={props.change}>Home</div>
                <div className='complete__button'>Next</div>
            </div>
        </div>
    )
}

export default Complete;
